const App = () => {
  let obj = ["Ronald", 21]; //array
  const obj2 = obj.concat("nuts");
  console.log(obj2);

  const m1 = [1, 2, 3];
  const m2 = m1.map((value) => "<li>" + value + "</li>");
  console.log(m2);
  obj.forEach((value) => {
    console.log(value);
  });

  const newFun = () => {
    console.log("Yeeha!");
  };
  newFun();

  const obj3 = {
    name: {
      fName: "Ronald",
      lName: "Lim",
    },
  };

  console.log(obj3.name.fName);

  const date = new Date();
  const a = 10;
  const b = 11;
  return (
    <div>
      <h1>{date.toString()}</h1>
      <h1>
        {" "}
        {a} + {b} is {a + b}
        <Hello name={obj} />
      </h1>
    </div>
  );
};

const Hello = (props) => {
  return (
    <div>
      <h1>
        woah!! {props.name}, {props.age},{props.test}
      </h1>
    </div>
  );
};

export default App;
